import BackDrop from './components/HOMEPAGE/backdrop/backdrop.component.jsx';

class NavigationBar extends Component {
    render() {
        return(
            <div>
                <Toolbar />
                <SideDrawer />
                <BackDrop />
            </div>
        );
    }
}

export default NavigationBar;
